// src/pages/About.js
import React from 'react';
import './About.css';

function About() {
  return (
    <div className="about">
      <h2>About Me</h2>
      <p>
        I am a passionate [Your Profession] with a focus on [Your Skills or Areas of Interest]. 
        My journey started in [Your Background], and I specialize in [Specialization/Skills].
      </p>
    </div>
  );
}

export default About;
